  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Sacramento, Delevan, Colusa, and Sutter NWRs
  for the next 15 years. This plan outlines the refuges' vision and purpose and describes
  how Sacramento, Delevan, Colusa, and Sutter NWRs will contribute to the overall
  mission of the Refuge System. The plan provides an introduction to the Complex,
  an overview of the CCP process, information about the environment, information about
  the management direction, current management programs, and strategies for implementation.
  Key planning issues include: wildlife management, habitat management, and public
  use.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
